import React from "react";
import "./Header.css";
const Header = ({ toggleSidebar }) => {
    return (
        <header className="header bg-primary text-white d-flex align-items-center justify-content-between px-4">
            <div className="d-flex align-items-center">
                <button className="btn btn-primary me-3" onClick={toggleSidebar}>
                    <i className="fas fa-bars"></i>
                </button>
                <img src="/logo.png" alt="Logo" className="logo" />
                <h1 className="ms-2">BTO AdayBilgi</h1>
            </div>
            <nav className="d-flex align-items-center">
                <a href="#" className="text-white mx-2">Anasayfa</a>
                <a href="#" className="text-white mx-2">Onay Beklenen İşlemler</a>
                <a href="#" className="text-white mx-2">Yaklaşan Etkinlikler</a>
                <div className="user-menu ms-4">
                    <i className="fas fa-bell"></i>
                    <div className="ms-2">
                        <span>Boray Güvenç</span>
                        <span className="d-block text-muted small">Koordinatör</span>
                    </div>
                    <i className="fas fa-caret-down ms-2"></i>
                </div>
            </nav>
        </header>
    );
};

export default Header;
